import './Contador.css';
import React, { useState } from 'react';

function Contador() {
    let valorContador = 0
    const incrementar = () => {
        valorContador += 1;
    };

  return (
    <div className = "contador">
        <h4>Contador: {valorContador}</h4>
        <button onClick={incrementar}>Incrementar</button>  
        <button id="decrementar">Decrementar</button>      
    </div>
  );
}

export default Contador;
